import React from "react";
import styles from "./app-header.module.css";
import '../../fonts/fonts.css';
import {Logo} from "@ya.praktikum/react-developer-burger-ui-components";
import {BurgerIcon} from "@ya.praktikum/react-developer-burger-ui-components";
import {ListIcon} from "@ya.praktikum/react-developer-burger-ui-components";
import {ProfileIcon} from "@ya.praktikum/react-developer-burger-ui-components";

function AppHeader(props) {
    return (
        <nav className={`${styles.appHeader} mt-4 mb-4`}>
            <ul className={`${styles.leftNavMenu} ml-5 mr-5`}>
                <li className={`${styles.primaryMenuItem} ml-5 mr-5`}>
                    <BurgerIcon type={"primary"} />
                    <p className="text text_type_main-default ml-2">Конструктор</p>
                </li>
                <li className={styles.secondaryMenuItem}>
                    <ListIcon type={"secondary"} />
                    <p className="text text_type_main-default ml-2">Лента заказов</p>
                </li>
            </ul>
            <div className={styles.logo}><Logo /></div>
            <div className={`${styles.rightNavMenu} ml-5 mr-5`}>
            <div className={styles.secondaryMenuItem}>
                <ProfileIcon type={"secondary"} />
                <p className="text text_type_main-default ml-2">Личный кабинет</p>
            </div>
            </div>
        </nav>
    );
}

export default AppHeader;
